import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section
            className='my-[30px] xl:mt-[100px]'
        >
            <div className='container mx-auto'>
                <div className='bg-accent-secondary/[15%] rounded-[50px] flex flex-col text-center xl:flex-row xl:items-center'>
                    {/* Each About */}
                    <div className='flex flex-row'>
                        {secondSection.map((item,idx)=>{
                            return (
                                <img src={item.icon} />
                            )
                        })}
                    </div>
                </div>
            </div>
        </section>
    )
}

export default About
